import React from "react";

const ProgresMateri = () => {
  return (
    <div
      style={{ backgroundColor: "grey", width: "180px", marginLeft: "70px" }}
    >
      <border>
        <tr>
          <td>
            {" "}
            <p
              style={{
                color: "black",
                fontWeight: "bold",
                marginLeft: "10px",
                paddingTop: "10px",
                paddingBottom: "0px",
              }}
            >
              Progres
            </p>
            <span style={{ marginLeft: "10px" }}>0%</span>
            <progress style={{ marginLeft: "10px" }}></progress>{" "}
            <hr style={{ color: "white", width: "180px" }} />
            <p style={{ marginLeft: "10px" }}>Modul 1</p>
          </td>
        </tr>
      </border>
    </div>
  );
};

export default ProgresMateri;
